import React, { useState } from "react";
import classes from "../filter/Lable.module.css";

const Lable = React.forwardRef((props, ref) => {
  // const [inputChecked, setInputChecked] = useState();
  // const [inputValue, setInputValue] = useState("");

  const onCheckLabel = (e) => {
    // setInputChecked(e.target.value);
    props.checkLable(props.label);
    // setInputValue(e.target.value);
    // props.onCheckBox(e.target.checked);
  };

  return (
    <>
      <label className={classes.container} htmlFor={props.label} ref={ref}>
        <input
          type="radio"
          id={props.label}
          onChange={onCheckLabel}
          name="filter"
        ></input>
        <span className={classes.checkmark}></span>
        <span>{props.label}</span>
      </label>
    </>
  );
});

export default Lable;
